// token, see: https://github.com/ConsenSys/Tokens. Cheers!

contract ErosJuridistiction {

	event BoundwithdrawRequest(address indexed Matcher, uint256 _value);
	event Boundwithdraw(address indexed Matcher, uint256 _value);
	event Sentence(address indexed _from, address indexed _to, uint256 _value);

	address public owner; //Contract owner

	mapping (address => uint) bounds; //Bounds for Matchers
	mapping (address => uint) withdrawUnlockPeriod; //When user can unlock funds
	mapping (address => uint) withdrawApprovedValue; //When user can unlock funds


	uint256 pendingPeriod = 30 days; 
	uint8 PENALITY = 50; // Percentage of bound lost when infractiong happen

	function ErosJuridistiction() {
		owner = msg.sender;
	}

	modifier ownerOnly() {

        require(msg.sender == owner);
        _;

	}

	modifier withdrawAllowed() {

		require(withdrawUnlockPeriod[msg.sender] != 0x0);
		require(now > withdrawUnlockPeriod[msg.sender]);
		_;

	}

	// Deposit ETH in contract
	function depositBound() public payable returns(bool success) {

		require(msg.value > 0);

		//Adding to current bound
		bounds[msg.sender] += bounds[msg.sender] + msg.value;

		return true;
	}

	// Starting the timer to allow bound withdraw
	function boundWithdrawRequest(uint256 _value) public returns (bool success) {

		require(_value > 0);
		require(bounds[msg.sender] >= _value);

		withdrawUnlockPeriod[msg.sender] = now + pendingPeriod;
		withdrawApprovedValue[msg.sender] = _value;

		BoundwithdrawRequest(msg.sender, _value);

		return true;
	}

	// withdraw of bounds
	function boundWithdraw(uint256 _value) public withdrawAllowed returns (bool success){

		require(_value > 0);
		require(withdrawApprovedValue[msg.sender] >= _value);

		// Reset withdrawUnlockPeriod
		withdrawUnlockPeriod[msg.sender] = 0x0;

		// Updating bound of Matcher
		bounds[msg.sender] -= _value;

		// Sending value to matcher
		require(msg.sender.send(_value));

		// Push event
		Boundwithdraw(msg.sender, _value);

		return true;

	}

}
